import styles from "./reserveBook.module.css";
import Navbar from "../../components/navbar/Navbar";
function ReserveBookPage() {
    return (
        <div className={styles["reserve-book"]}>
            <Navbar />
            <div className={styles["reserve-container"]}></div>
            <div className={styles["top"]}>
                <div className={styles["top-left"]}>
                    <h1>Hanoi</h1>
                    <p>
                        Lorem ipsum dolor, sit amet consectetur adipisicing
                        elit. Odit deserunt doloremque inventore minima quidem
                        enim cum eos obcaecati? Omnis, nostrum!
                    </p>
                </div>
                <div className={styles["top-right"]}>
                    <div>$350 (1 night)</div>
                    <button>Reserve or Book now</button>
                </div>
            </div>
        </div>
    );
}

export default ReserveBookPage;
